import React from 'react';
import { Box, Heading } from 'grommet';

const landing = ({ location, fetchSuccess }) => {
  return (
    <React.Fragment>
      <Box 
        animation="fadeIn"
        justify="center" 
        align="center" 
        height="100%" 
      >
        <Heading 
          color="dark-1" 
          margin="none"
          size="small"
          textAlign="center" 
        >
          {/* Where to eat in */}
          {fetchSuccess || fetchSuccess === '' ? "Where to eat in" : "Unable to get your location"}
        </Heading>
        <Heading 
          color="status-warning" 
          margin="none"
          size="large" 
        >
          {/* {location} */}

          {fetchSuccess || fetchSuccess === '' ? location : null}
        </Heading>
      </Box>
    </React.Fragment>
  )
}

export default landing;
